            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    L'éducation doit être un moyen de donner aux enfants comme aux adultes la possibilité de devenir participants actifs de la transformation des
                    sociétés dans lesquelles ils vivent. L'apprentissage doit aussi prendre en compte les valeurs, les attitudes et les comportements qui permettent aux
                    individus d'apprendre à vivre ensemble dans un monde qui se caractérise par la diversité et le pluralisme. Ce domaine du savoir est ce que veulent
