            WriteLiteral(@"’une manière ou d’une autre a rendre l’éducation
                    conforme a ce que nous souhaitons, a ce que nous voulons tout simplement. C’est donc pour outiller les professionnels de l’éducation afin qu’ils
                    réussissent mieux leur noble mission d’éducation que le Master en Sciences de l’éducation que trois (3) parcours sont proposés a savoir Analyse
                    et conception en éducation et formation, Education en situations d’urgence et Ingénierie des systèmes d’organisation.
                </p>
