                <h3 class=""small_heading""> II.3. Approche du programme </h3>
                <p class=""description""> 
                    Alors que le Bachelor/Licence en sciences de l'éducation est une formation générale, ouverte sur les nombreuses disciplines qui composent les
                    sciences de l'éducation, la formation de Master permet d'approfondir des aspects spécifiques et de se construire son propre profil professionnel,
                    en phase avec les problèmes actuels de l'éducation.
                    Le Master première année (M1) Sciences de l’éducation est une formation qui prolonge les enseignements dispensés en licence Sciences de
                    l’éducation. Les connaissances et compétences visées dans le cadre de ce M1 sont d’or");
            WriteLiteral(@"dre théorique et méthodologique. Elles sont, d’une part,
